using namespace std;
class Solution {
public:
	int smallestDistancePair(vector<int>& nums, int k) {
		std::sort(nums.begin(), nums.end());
		int i, j, c = 0, n = nums.size();
		int mi, lo=0, hi=nums[n-1]-nums[0];
		while (lo < hi) {
			mi = lo + (hi-lo)/2;
			for (i=0, j=0; i<n; ++i) {
				while (j<n && (nums[j]-nums[i] <= mi)) ++j;
				c += j-i-1;
			}
			//printf("%d %d %d %d\n", c, lo, mi, hi);
			if (c < mi)
				lo=mi+1;
			else
				hi=mi;
		}
		return lo;
	}
	int smallestDistancePair2(vector<int>& nums, int k) {
		std::vector<int> v;
		for (int i=0; i<nums.size(); ++i) {
			for (int j=i+1; j<nums.size(); ++j)
				v.push_back(abs(nums[i]-nums[j]));
		}
		std::sort(v.begin(), v.end());
		return v[k-1];
	}
};
